import React, { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import Dropdown from 'react-bootstrap/Dropdown';
import Form from 'react-bootstrap/Form';

export default function DataType() {
  const [display, setDisplay] = useState('Select');
    return (
    <div style={{ display: 'block', 
                  width: 700, 
                  padding: 30 }}>
      <h4>Data Set Type: </h4>
      <Dropdown>
        <Dropdown.Toggle variant="primary">
          {display}
        </Dropdown.Toggle>
        <Dropdown.Menu>
          <Dropdown.Item href="#" onClick={() => setDisplay("Pk Study")}>
            Pk Study
          </Dropdown.Item>
          <Dropdown.Item href="#" onClick={() => setDisplay("IVT Study")}>
            IVT Study
          </Dropdown.Item>
          <Dropdown.Item href="#" onClick={() => setDisplay("Other")}>
            Other
          </Dropdown.Item>
        </Dropdown.Menu>
      </Dropdown>
      <Form>

          <Form.Control type="text" placeholder="Enter Data Set Type" />

      </Form>
    </div>
    );
}
